        <br />
        <label htmlFor={func.dimension + "_one"}>wymiary: </label>
        <input type="number" id={func.dimension + "_one"} value={func.dimension} maxLength={1} className="smallNumInput"></input>

        {/* for (let i=0; i<2; i++){

